import React from "react";
import Card from "./CardHome";
import styles from "../../../style/common/CardHome.module.css";
import Title from "../../common/Title";

function CardRow() {
    const data = [
        {
            src: "/toy-images/01.png",
            title: "Spider-Man No Way-Home",
            desc: "₹1,79,944.94",
        },
        {
            src: "/toy-images/02.png",
            title: "Iron-Man",
            desc: "₹1,15,704.60",
        },
        {
            src: "/toy-images/03.png",
            title: "Captain America",
            desc: "₹1,25,871.49",
        },
        {
            src: "/toy-images/04.png  ",
            title: "Black Panther",
            desc: "₹35,719.07 ",
        },
        {
            src: "/toy-images/05.png",
            title: "Thunder Thor",
            desc: "₹8,421.74 + Tax",
        },

    ];



    return (
        <div>
            <Title title="MARVEL TOY'S" />
            <div className={styles.map1}>
                {data.map((value, index) => {
                    return (
                        <Card
                            key={index}
                            src={value.src}
                            title={value.title}
                            desc={value.desc}
                        />
                    );
                })}
            </div>

            {/* T-Shirts */}


        </div>
    );
}

export default CardRow;
